$(document).ready(function(){$("body").on("fileActionEvent",function(b,c){if(c.obj.hasClass("disabled")||!c.obj.hasClass("dwnload")){return}if(!c.obj.hasClass("disablebinarydownload")){window.location.href=window.location.pathname+"?"+$.param({action:"dwnload",file:c.file})}else{var a=window.location.pathname.lastIndexOf("/")+1==window.location.pathname.length?"":"/";window.location.href=window.location.pathname+a+c.file}})});